// SideNavigation.js

import React from 'react';
import './SideNavigation.css'; // Make sure to create this CSS file for styling

const SideNavigation = ({ onSort }) => {
  return (
    <div className="side-navigation">
      <h3>Sort Options</h3>
      <button onClick={() => onSort('date', 'desc')}>Date (Newest)</button>
      <button onClick={() => onSort('date', 'asc')}>Date (Oldest)</button>
      <button onClick={() => onSort('status')}>Status</button>
    </div>
  );
};

export default SideNavigation;
